//Выбор нужного бита для проверки запуска операции межпроцессорного обмена
_Bool operation_is_started(unsigned short address) {
  if (check_addr_yust(1, address)) {
    return send_yust;
  } else {
    switch (address) {
      case MA_PART_RECEIVE_DIG_OSCILOGRAPH:
        return start_update_adc;
      case MA_PART_SETTINGS_FIRST_ADDR:
        switch (modbus_func_id) {
          case MODBUS_FUNC6:
            return get_settings;
          case MODBUS_FUNC16:
            return send_settings;
          default:
            //Неопределенная ошибка
            return true;
        }
      default:
        //Неопределенная ошибка
        return true;
    }  
  }
}

//Выбор и установка в true нужного бита для сигнализирования запуска межпроц. обмена
void start_operation(unsigned short address) {
  if (check_addr_yust(1, address)) {
    send_yust = true;
  } else {
    switch (address) {
      case MA_PART_RECEIVE_DIG_OSCILOGRAPH:
        start_update_adc = true;
        return;
      case MA_PART_SETTINGS_FIRST_ADDR:
        switch (modbus_func_id) {
          case MODBUS_FUNC6:
            get_settings = true;
            return;
          case MODBUS_FUNC16:
            send_settings = true;
            return;
          default:
            //Неопределенная ошибка
            return;
        }
      default:
        //Неопределенная ошибка
        return;
    }
  }
}

//Если в процессе межпроц. обмена возникла ошибка нужно определить тип операции
//и зафиксировать ошибку в определенной переменной
void set_error(unsigned short address) {
  if (check_addr_yust(1, address)) {
    switch (modbus_func_id) {
      case MODBUS_FUNC3:
        error_get_yust = true;
        return;
      case MODBUS_FUNC16:
        error_send_yust = true;
        return;
      default:
        //Неопределенная ошибка
        return;
    }
  } else {
    switch (address) {
      case MA_PART_RECEIVE_DIG_OSCILOGRAPH:
        error_update_data_from_adc = true;
        return;
      case MA_PART_SETTINGS_FIRST_ADDR:
        switch (modbus_func_id) {
          case MODBUS_FUNC6:
            error_get_settings = true;
            return;
          case MODBUS_FUNC16:
            error_send_settings = true;
            return;
          default:
            //Неопределенная ошибка
            return;
        }
      default:
        //Неопределенная ошибка
        return;
    }
  }
}

//Выбор функции межпроцессорного обмена для запуска
unsigned char select_func_and_run(unsigned short address, long lActivation) {
  if (check_addr_yust(1, address)) {
    return ReqSendYustBM(lActivation, &pYustStateDsc);
  } else {
    switch (address) {
      case MA_PART_RECEIVE_DIG_OSCILOGRAPH:
        return ReqArTenPerData(lActivation, &arTenPerStateDsc);
      case MA_PART_SETTINGS_FIRST_ADDR:
        switch (modbus_func_id) {
          case MODBUS_FUNC6:
            return ReqGetSettingsBM(lActivation, &pSettigsStateDscTmp1);
          case MODBUS_FUNC16:
            return ReqSendSettingsBM(lActivation, &pSettigsStateDscTmp1);
          default:
            //Неопределенная ошибка
            return ERROR_EXEC;
        }
      default:
        //Неопределенная ошибка
        return ERROR_EXEC;
    }
  }
}

void start_response(unsigned char* response, unsigned int size) {
  switch (source_id) {
    case USB_SOURCE:
      UsbDataWrite(response, size);
      response_ready = true;
      return;
    case RS_485_SOURCE:
      WriteDataRS485(response, size);
      response_ready = true;
      return;
    default:
      //Неопределенная ошибка
      //do nothing
      return;
  }
}

void clean_arr(unsigned char* pArr, unsigned int size) {
  for (unsigned int i = 0; i < size; i++) {
    *(pArr + i) = 0;
  }
}

void func1() {
  unsigned short crc16;
  unsigned char response[256];
  unsigned short address = (*(puchMsg + ADDRESS_OFFSET) << 8 | *(puchMsg + ADDRESS_OFFSET + 1) );
  unsigned short quantity_of_outputs = *(puchMsg + QUANTITY_OF_OUTPUTS_FUNC1_OFFSET) << 8 |
                                       *(puchMsg + QUANTITY_OF_OUTPUTS_FUNC1_OFFSET + 1);
  
  unsigned short quantity_of_bytes = (quantity_of_outputs % 8) == 0 ? quantity_of_outputs >> 3 : (quantity_of_outputs >> 3) + 1;
  clear_all_updating_state(2, address);
  
  response[0] = eeprom_bs_settings_tbl.RS_comm_addres;
  response[1] = modbus_func_id;
  response[2] = quantity_of_bytes & 0x00ff;
  
  int index = 3;
  
  if(check_addr_dig_outputs(quantity_of_outputs, address)) {
    
    CfgTblDsc* pConfig = &eeprom_prt_tbl;
    
    int start_addr_do = address - START_BIT_ADDR_ACTIVE_FUNCTIONS;
    
    unsigned char temp;
    unsigned int counter = quantity_of_outputs;
    for(int i = 0; i < quantity_of_bytes; i++, counter -= 8) {
          temp = 0x00;
          char mask = ~(0xff << ((counter > 8)? 8 : counter));
          
          int bitPosition = start_addr_do % 8;
          int indexArray = (start_addr_do + 8*i) >> 3;
          
          temp = ( (pConfig -> arUchTypeOuts[indexArray]) & (mask << bitPosition) ) >> bitPosition;
          if ((bitPosition + counter) > 8) {
              temp |= ((pConfig -> arUchTypeOuts[indexArray + 1]) & (mask >> ( 8 - bitPosition))) << bitPosition;
          }
          
          response[index++] = temp;
      }
      crc16 = CRC16(response, index);
      response[index++] = (crc16 & 0xff00) >> 8;
      response[index++] = crc16 & 0x00ff;
      start_response(response, index);
      reset_all_modbus_modes();
  } else if (check_addr_active_func(quantity_of_outputs, address)) {
    
    int start_addr_do = address - START_ADDR_DO_VALUES;
    
    unsigned char temp;
    unsigned int counter = quantity_of_outputs;
    for(int i = 0; i < quantity_of_bytes; i++, counter -= 8) {
          temp = 0x00;
          char mask = ~(0xff << ((counter > 8)? 8 : counter));
          
          int bitPosition = start_addr_do % 8;
          int indexArray = (start_addr_do + 8*i) >> 3;
          
          temp = ( (ActiveFuncStore[indexArray]) & (mask << bitPosition) ) >> bitPosition;
          if ((bitPosition + counter) > 8) {
              temp |= ((ActiveFuncStore[indexArray + 1]) & (mask >> ( 8 - bitPosition))) << bitPosition;
          }
          
          response[index++] = temp;
      }
      crc16 = CRC16(response, index);
      response[index++] = (crc16 & 0xff00) >> 8;
      response[index++] = crc16 & 0x00ff;
      start_response(response, index);
      reset_all_modbus_modes();
  } else if (check_addr_tripped_func(quantity_of_outputs, address)) {
    
    int start_addr_do = address - START_ADDR_DO_VALUES;
    
    unsigned char temp;
    unsigned int counter = quantity_of_outputs;
    for(int i = 0; i < quantity_of_bytes; i++, counter -= 8) {
          temp = 0x00;
          char mask = ~(0xff << ((counter > 8)? 8 : counter));
          
          int bitPosition = start_addr_do % 8;
          int indexArray = (start_addr_do + 8*i) >> 3;
          
          temp = ( (trippedFuncStore[indexArray]) & (mask << bitPosition) ) >> bitPosition;
          if ((bitPosition + counter) > 8) {
              temp |= ((trippedFuncStore[indexArray + 1]) & (mask >> ( 8 - bitPosition))) << bitPosition;
          }
          
          response[index++] = temp;
      }
      crc16 = CRC16(response, index);
      response[index++] = (crc16 & 0xff00) >> 8;
      response[index++] = crc16 & 0x00ff;
      start_response(response, index);
      reset_all_modbus_modes();
  }
}

