void func5() {
  unsigned short crc16;
  unsigned char response[256];
  unsigned short address = (*(puchMsg + ADDRESS_OFFSET) << 8) | *(puchMsg + ADDRESS_OFFSET + 1);
  unsigned short const_out = *(puchMsg + CONST_OUT_ADDRESS_FUNC5_OFFSET) << 8 |
                              *(puchMsg + CONST_OUT_ADDRESS_FUNC5_OFFSET + 1);
  clear_all_updating_state(0, 0);
  int mask = const_out > 0 ? 1 : 0;
  mask <<= address - START_ADDRESS_OF_FIRST_OUTPUT;
  
  response[0] = eeprom_bs_settings_tbl.RS_comm_addres;
  response[1] = modbus_func_id;  
  response[2] = *(puchMsg + ADDRESS_OFFSET);
  response[3] = *(puchMsg + ADDRESS_OFFSET + 1);
  response[4] = const_out > 0 ? 0xff : 0;
  response[5] = 0;
  
  if(check_addr_of_outputs(1, address))
  {
    if (const_out > 0)
    {
      tmp_outputs |= mask;
    }
    else
    {
      tmp_outputs &= mask;
    }
  }
  
  crc16 = CRC16(response, 6);
  response[6] = (crc16 & 0xff00) >> 8;
  response[7] = crc16 & 0xff;
  start_response(response, 8);
  reset_all_modbus_modes();
}

