          break;
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F1 << 4) + BIT_RESET_LED:
          NumberOfFunction = RESET_LED_DI_OEPRF_ONB;
          break;
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F1 << 4) + BIT_BLOCK_SWITCHOVER:
          NumberOfFunction = BLOCK_SWITCHOVER_DI_OEPRF_ONB;
          break;
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F1 << 4) + BIT_SWITCH_STATE:
          NumberOfFunction = SWITCH_STATE_DI_OEPRF_ONB;
          break;
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F1 << 4) + BIT_PERMIT_BLK_SW_MCP:
          NumberOfFunction = PERMIT_BLK_SW_MCP_DI_OEPRF_ONB;
          break;
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F1 << 4) + BIT_OVER_I_NOM_OFF_HSW:
          NumberOfFunction = OVER_I_NOM_OFF_HSW_OEPRF_ONB;
          break;
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F1 << 4) + BIT_LIMIT_OUT_HWS:
          NumberOfFunction = LIMIT_OUT_HWS;
          break;
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F1 << 4) + BIT_LIMIT_CRITICAL_HWS:
          NumberOfFunction = LIMIT_CRITICAL_HWS;
          break;
        /******** БЛОКИРОВКИ ДИСТ **********/
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F2 << 4) + BIT_BLOCK_DSTP1:
          if((pConfig->arUchCfgPrt[DSTP_CFG_PRT_ONB >> 8] & (1 << (DSTP_CFG_PRT_ONB % 8))) == 0) {
            modbus_dev_state = ILLEGAL_DATA_VALUE;
            return;
          }
          NumberOfFunction = BLOCK_DSTP1_DI_OEPRF_ONB;
          break;
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F2 << 4) + BIT_BLOCK_DSTP2:
          if((pConfig->arUchCfgPrt[DSTP_CFG_PRT_ONB >> 8] & (1 << (DSTP_CFG_PRT_ONB % 8))) == 0) {
            modbus_dev_state = ILLEGAL_DATA_VALUE;
            return;
          }
          NumberOfFunction = BLOCK_DSTP2_DI_OEPRF_ONB;
          break;
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F2 << 4) + BIT_ACCLT_DSTP2:
          if((pConfig->arUchCfgPrt[DSTP_CFG_PRT_ONB >> 8] & (1 << (DSTP_CFG_PRT_ONB % 8))) == 0) {
            modbus_dev_state = ILLEGAL_DATA_VALUE;
            return;
          }
          NumberOfFunction = ACCLT_DSTP2_DI_OEPRF_ONB;
          break;
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F2 << 4) + BIT_BLOCK_ACCLT_DSTP2:
          if((pConfig->arUchCfgPrt[DSTP_CFG_PRT_ONB >> 8] & (1 << (DSTP_CFG_PRT_ONB % 8))) == 0) {
            modbus_dev_state = ILLEGAL_DATA_VALUE;
            return;
          }
          NumberOfFunction = BLOCK_ACCLT_DSTP2_DI_OEPRF_ONB;
          break;
          
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F2 << 4) + BIT_BLOCK_DSTP3:
          if((pConfig->arUchCfgPrt[DSTP_CFG_PRT_ONB >> 8] & (1 << (DSTP_CFG_PRT_ONB % 8))) == 0) {
            modbus_dev_state = ILLEGAL_DATA_VALUE;
            return;
          }
          NumberOfFunction = BLOCK_DSTP3_DI_OEPRF_ONB;
