        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F2 << 4) + BIT_BLOCK_ACCLT_DSTP3:
          if((pConfig->arUchCfgPrt[DSTP_CFG_PRT_ONB >> 8] & (1 << (DSTP_CFG_PRT_ONB % 8))) == 0) {
            modbus_dev_state = ILLEGAL_DATA_VALUE;
            return;
          }
          NumberOfFunction = BLOCK_ACCLT_DSTP3_DI_OEPRF_ONB;
          break;
        case START_ADDR_ACTIVE_FUNCTIONS * 100 + (REG_ADDR_F2 << 4) + BIT_BLOCK_DSTP4:
          if((pConfig->arUchCfgPrt[DSTP_CFG_PRT_ONB >> 8] & (1 << (DSTP_CFG_PRT_ONB % 8))) == 0) {
            modbus_dev_state = ILLEGAL_DATA_VALUE;
            return;
          }
          NumberOfFunction = BLOCK_DSTP4_DI_OEPRF_ONB;
          break;
